import Link from 'next/link';

const background = {
    background: "url(/static/background.png)"
}

class LandingPage extends React.Component {
    render() {
        return (
            <div style={background}>
                <div>
                    <Link href="/dealer">
                        <a>Dealer</a>
                    </Link>
                    <Link href="/customer">
                        <a>Customer</a>
                    </Link>
                </div>
            </div>
        );
    }
}

export default LandingPage;
